const myImage = new Image();
myImage.src = 'data:image/jpeg;base64,';

myImage.addEventListener('load', function()
{
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 330;   
    canvas.height = 414;


    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height); //vector que tiene el rojo, verde, azul y alfa de cada píxel
    //0,0 la primera coordenada a buscar, canvas.width, canvas.height la última coordenada a mirar
    //rgba(rojo, verde, azul, alfa) como max 255, min 0 
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    let particlesArray = [];
    const numberOfParticles = 6000;
    
    let mappedImage = []; //contiene el brightness level de cada píxel
    for(let y=0; y<canvas.height; y++)
    {
        let row = [];
        for(let x=0; x<canvas.width; x++)
        {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [ cellBrighness = brightness];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue)
    {
        return Math.sqrt(   //esto es pq el ojo humano no percibe los 3 colores igual
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
    }


    class Particle
    {
        constructor()
        {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }

        update()
        {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity; //2.5 es el máximo

            this.y += movement;
            if(this.y >= canvas.height)
            {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }

        draw()
        {
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }

    }

    function init()
    {
        for(let i=0; i<numberOfParticles; i++)
        {
            particlesArray.push(new Particle);
        }
    }
    init();
    function animate()
    {
        ctx.globalAlpha = 0.05; //0 transparente, 1 opaco
        ctx.fillStyle = 'rgb(0, 0, 0)' //negro
        ctx.fillRect(0, 0, canvas.width, canvas.height);    //rectángulo del tamaño de todo el canvas
        ctx.globalAlpha = 0.2;
        for(let i=0; i< particlesArray.length; i++)
        {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.4;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

})
